    def __init__(self) -> None:
        super().__init__()
        self.alpha_dropout1 = nn.AlphaDropout(p=0.5)
        self.reflection_pad3d1 = nn.ReflectionPad3d(padding=1)
        self.lp_pool2d1 = nn.LPPool2d(norm_type=2, kernel_size=2, stride=2)
