    def forward(self, x):
        # Apply AlphaDropout
        x = self.alpha_dropout1(x)
        
        # Reshape to 5D for ReflectionPad3d
        x = x.unsqueeze(2)  # Add a dummy dimension to make it 5D
        x = self.reflection_pad3d1(x)
        x = x.squeeze(2)  # Remove the dummy dimension
        
        # Apply LPPool2d
        x = self.lp_pool2d1(x)
        
        # Apply AlphaDropout again
        x = self.alpha_dropout2(x)
        
        # Reshape to 5D for ReflectionPad3d
        x = x.unsqueeze(2)  # Add a dummy dimension to make it 5D
        x = self.reflection_pad3d2(x)
        x = x.squeeze(2)  # Remove the dummy dimension
        
        # Apply LPPool2d again
        x = self.lp_pool2d2(x)
        
        return x


